import { Link } from 'react-router-dom';

const Login = () => {
  const isLogin = true;
  return (
    <>
      <div>로그인 페이지</div>
      <a href="/">나가기</a>
      <Link to="/profile/isLogin?true">로그인 완료</Link>
    </>
  );
};
export default Login;
